import "../../App.css";
import React, { useState, useEffect } from "react";
import Axios from "axios";
import { Container, Table } from "react-bootstrap";

const ShowBasicsTools = () => {
  const mission_id = JSON.parse(window.sessionStorage.getItem("mission"))
    .mission_id;
    
    useEffect(() => {
     
    Axios.get("/basics/" + mission_id).then((response) => {
      const tempArray = [];
      tempArray.push(response.data);
      setBasicsList(tempArray);
      console.log("tempArray", tempArray);
      console.log("basicsList", basicsList);
    });
  }, []);

  const [basicsList, setBasicsList] = useState([]); 


  



  return (
    <div>
      <Container>
        <div style={{ textAlign: "center" }}>
          <b>Mission Basics Table With Tools</b>
        </div>
        <Table striped bordered hover size="sm">
          <thead>
            <tr>
              <th>Tool ID</th>
              <th>Tool Name</th>
             
              <th>Tool Category</th>
              <th>Summary</th>
              <th>Notes</th>
              <th>Start_date</th>
              <th>End_date</th>
              <th>Cover_img</th>
              <th>Description</th>
              <th>Tool Name</th>
            </tr>
          </thead>
          <tbody>
           
            {basicsList.map((data, index) => (
              <tr key={index}>
                <td>{data.tool_details[0].tool_id}</td>
                <td>{data.tool_details[0].tool_name}</td>
                <td>{data.tool_details[0].tool_category}</td>
                <td>{data.status}</td>
                <td>{data.category}</td>
                <td>{data.summary}</td>
                <td>{data.notes}</td>
                <td>{data.start_date}</td>
                <td>{data.end_date}</td>
                <td>
                  <img
                    src={data.cover_img}
                    style={{ width: "100px" }}
                    alt={data.name}
                  ></img>
                </td>
                <td>{data.description}</td>
                <td>{data.tool_details[0].tool_name}</td>
              </tr>
            
            ))}
          </tbody>
        </Table>
      </Container>
    </div>
  );
};

export default ShowBasicsTools;
